    if (temperature >= 20 && temperature <= 30) {
      return 'blue';
    } else if(temperature >= 30 && temperature <= 33){
      return 'yellow';
    }
    else if (temperature >= 34 && temperature <= 37) {
      return 'lime'; // Verde fosforescente
    } else if (temperature >= 38 && temperature <= 39) {
      return 'pink';
    } else if (temperature >= 40) {
      return 'red';
    } else {
      return 'red'; // Puedes cambiar esto segn tus necesidades para temperaturas fuera de los rangos especificados
    }
